import React from "react";
import { Redirect, Switch } from "react-router-dom";
import { AccountingYear } from "./AccountingYear"
import { AccountingYearEdit } from "./accounting-year-edit/AccountingYearEdit"
import { ContentRoute } from "../../../../_metronic/layout";

export function AccountingYearPage() {
  return (
    <Switch>
      <Redirect
        exact={true}
        from="/master-configure/accounting-year"
        to="/master-configure/accounting-year/list"
      />

      <ContentRoute
        path="/master-configure/accounting-year/list"
        component={AccountingYear}
      />
      <ContentRoute
        path="/master-configure/accounting-year/add"
        component={AccountingYearEdit}
      />
    </Switch>
  );
}
